def delete_primes(arr, n):
    if n <= 0 and len(arr) == 0:
        return arr

    def is_prime(num):
        if num <= 1:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True
    primes = [arr[i] for i in range(min(n, len(arr))) if is_prime(arr[i])]
    return [x for x in arr if x not in primes]

